import React from "react";
import StudentOption from "./StudentOption";
import RouteButton from "./RouteButton";

export default class TASelectPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      studentOptions: [],
    };
  }

  componentDidMount = () => {
    fetch("/Students_Online")
    .then((response) => {
      console.log(response)
      if (response.status == 404) {
        alert("Error: Couldn't connect to server");
        return "";
      } else {
        return response.json();
      }
    })
    .then((data) => {
      console.log(data);
    })
  };

  render() {
    return (
      <div className="pageContainer">
        <RouteButton
          active={true}
          text={"Back"}
          onclick={() => {
            return true;
          }}
          route={"/"}
          buttonType={"backButton"}
        />
        <div className="outerShell">
          <div className="selectContainer">
            {this.state.studentOptions.map((student) => {
              return <StudentOption key={student.name} name={student.name} email={student.email} role={student.role}/>;
            })}
          </div>
        </div>
      </div>
    );
  }
}
